import React from 'react';

import MainContainer from '../components/main-container';

import '../App.css';

var buttonPressed = "1"

export default class MessageContainer extends React.Component {
  constructor(props) {
    super(props);

    this.state = ({
      selectedObjects: [],
      total:0,
      page:"Ordenar",
      currentState:buttons[0].state0
    });
  }

  manageButtonsState = () => {
    var i  = 0;
    this.props.data.map((d) => {
      if(i===0){
        buttonPressed = d
      }
      i+=1
      return(<li>{d}</li>)
    })
    i=0
    console.log(buttonPressed)
    console.log(this.state.page)
    switch (buttonPressed) {
      case "button1":
        switch (this.state.page){
          case "Ordenar": 
            return <MainContainer properties={buttons[0]}/>;
          case 'Breakfast': 
            return <MainContainer />; 
          case 'Lunch': 
            return <MainContainer />;
          case 'Dinner': 
            return <MainContainer />; 
          case 'Drinks': 
            return <MainContainer />;
          case 'Pagar': 
            return <MainContainer />;  
          default:
            return <MainContainer />; 
        }
      case "button2":
          switch (this.state.page){
            case "Inicio":
              console.log("Going from Inicio to Ordenar") 
              return <MainContainer properties={buttons[0]}/>;
            case 'Breakfast': 
              return <MainContainer />; 
            case 'Lunch': 
              return <MainContainer />;
            case 'Dinner': 
              return <MainContainer />; 
            case 'Drinks': 
              return <MainContainer />;
            case 'Pagar': 
              return <MainContainer />;  
            default:
              return <MainContainer />; 
          }
        case "button3":
            switch (this.state.page){
              case 'Ordenar':
                return <MainContainer properties={this.state.currentState}/>;
              case 'Breakfast': 
                return <MainContainer />; 
              case 'Lunch': 
                return <MainContainer />;
              case 'Dinner': 
                return <MainContainer />; 
              case 'Drinks': 
                return <MainContainer />;
              case 'Pagar': 
                return <MainContainer />;  
              default:
                return <MainContainer />; 
            }
          case "button4":
              switch (this.state.page){
                case 'Ordenar': 
                  return <MainContainer />;
                case 'Breakfast': 
                  return <MainContainer />; 
                case 'Lunch': 
                  return <MainContainer />;
                case 'Dinner': 
                  return <MainContainer />; 
                case 'Drinks': 
                  return <MainContainer />;
                case 'Pagar': 
                  return <MainContainer />;  
                default:
                  return <MainContainer />; 
              }
            case "button5":
                switch (this.state.page){
                  case 'Ordenar': 
                    return <MainContainer />;
                  case 'Breakfast': 
                    return <MainContainer />; 
                  case 'Lunch': 
                    return <MainContainer />;
                  case 'Dinner': 
                    return <MainContainer />; 
                  case 'Drinks': 
                    return <MainContainer />;
                  case 'Pagar': 
                    return <MainContainer />;  
                  default:
                    return <MainContainer />; 
                }
      default:
          switch (this.state.page){
            case "Inicio": 
              console.log("Currently in state Inicio") 
              return <MainContainer properties={buttons[0]}/>;
            case "Ordenar": 
              console.log("Currently in state Ordenar") 
              return <MainContainer properties={buttons[1]}/>;
            case 'Breakfast': 
              return <MainContainer />; 
            case 'Lunch': 
              return <MainContainer />;
            case 'Dinner': 
              return <MainContainer />; 
            case 'Drinks': 
              return <MainContainer />;
            case 'Pagar': 
              return <MainContainer />;  
            default:
              return <MainContainer />; 
          } 
    }
  }

  render(){
    return (
      <div className="AppFS">
        {this.manageButtonsState()}
      </div>
    )
  }
}


const buttons = [
                [{label:"Back", visibility:false},
                 {label:"Ordenar", visibility:true},
                 {label:"Llamar mesero", visibility:true},
                 {label:"Pagar", visibility:true},
                 {label:"Back", visibility:false}],
                [{label:"Back", visibility:true},
                 {label:"Ordenar", visibility:false},
                 {label:"Llamar mesero", visibility:true},
                 {label:"Pagar", visibility:true},
                 {label:"Seguir", visibility:true}]
                ]
